import React, { useState } from 'react';
import { Button, Box, Typography, Container, CssBaseline, Snackbar, Alert } from '@mui/material';
import { useParams, useNavigate } from 'react-router-dom'; // Ensure useNavigate is imported
import CreateIcon from '@mui/icons-material/Create';
import SaveAltIcon from '@mui/icons-material/SaveAlt';
import ViewListIcon from '@mui/icons-material/ViewList';
import { createTheme, ThemeProvider } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#6C757D',
    },
    info: {
      main: '#17A2B8',
    },
  },
  typography: {
    fontFamily: '"Roboto", "Helvetica", "Arial", sans-serif',
  },
});

const RosterManagement = () => {
  const { flightnum } = useParams(); // Get flight number from URL parameters
  const [snackbarOpen, setSnackbarOpen] = useState(false);
  const [snackbarMessage, setSnackbarMessage] = useState('');
  const [snackbarSeverity, setSnackbarSeverity] = useState('success');

  const handleSnackbarClose = () => {
    setSnackbarOpen(false);
  };

  const handlePostRequest = (url) => {
    fetch(url, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ flight_number: flightnum }),
    })
      .then((response) => response.json())
      .then((data) => {
        if (data.message) {
          setSnackbarSeverity('success');
          setSnackbarMessage(data.message);
        } else {
          setSnackbarSeverity('error');
          setSnackbarMessage(data.error || 'An error occurred');
        }
        setSnackbarOpen(true);
      })
      .catch((error) => {
        setSnackbarSeverity('error');
        setSnackbarMessage('An error occurred');
        setSnackbarOpen(true);
      });
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Container component="main" maxWidth="md" sx={{ height: '100vh', display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
        <Box
          sx={{
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            background: 'linear-gradient(180deg, #f0f4ff 0%, #d0e2ff 100%)',
            padding: 6,
            borderRadius: 2,
            boxShadow: '0 3px 5px 2px rgba(0, 0, 0, 0.1)',
            textAlign: 'center',
            width: '100%',
          }}
        >
          <Typography component="h1" variant="h4" color="textSecondary" gutterBottom>
            Roster Management
          </Typography>
          <Box sx={{ mt: 4, width: '100%' }}>
            <Button
              startIcon={<CreateIcon />}
              variant="contained"
              sx={{
                width: '100%',
                mb: 2,
                bgcolor: 'primary.main',
                color: 'white',
                '&:hover': { bgcolor: 'primary.dark' },
                transition: 'all 0.3s ease',
                padding: 2,
                fontSize: '1.1rem',
              }}
              onClick={() => handlePostRequest(`http://localhost:8080/backend/export/mysql/${flightnum}/`)}
            >
              Create Roster (SQL)
            </Button>
            <Button
              startIcon={<CreateIcon />}
              variant="contained"
              sx={{
                width: '100%',
                mb: 2,
                bgcolor: 'primary.main',
                color: 'white',
                '&:hover': { bgcolor: 'primary.dark' },
                transition: 'all 0.3s ease',
                padding: 2,
                fontSize: '1.1rem',
              }}
              onClick={() => handlePostRequest(`http://localhost:8080/backend/export/mongodb/${flightnum}/`)}
            >
              Create Roster (NoSQL)
            </Button>
            <Button
              startIcon={<SaveAltIcon />}
              variant="contained"
              sx={{
                width: '100%',
                mb: 2,
                bgcolor: 'primary.main',
                color: 'white',
                '&:hover': { bgcolor: 'primary.dark' },
                transition: 'all 0.3s ease',
                padding: 2,
                fontSize: '1.1rem',
              }}
              onClick={() => handlePostRequest(`http://localhost:8080/backend/export/json/${flightnum}/`)}
            >
              Export Roster (JSON)
            </Button>
            <Button
              startIcon={<ViewListIcon />}
              variant="contained"
              sx={{
                width: '100%',
                mb: 2,
                bgcolor: 'primary.main',
                color: 'white',
                '&:hover': { bgcolor: 'primary.dark' },
                transition: 'all 0.3s ease',
                padding: 2,
                fontSize: '1.1rem',
              }}
              onClick={() => navigate(`/view-roster`)}
            >
              View Roster
            </Button>
          </Box>
        </Box>
      </Container>
      <Snackbar open={snackbarOpen} autoHideDuration={6000} onClose={handleSnackbarClose}>
        <Alert onClose={handleSnackbarClose} severity={snackbarSeverity} sx={{ width: '100%' }}>
          {snackbarMessage}
        </Alert>
      </Snackbar>
    </ThemeProvider>
  );
};

export default RosterManagement;
